        return (
            <div id="child">
                <div className="intro-box">
                    <FadeIn><h1>Hey</h1></FadeIn>
                    <h1>Hello World!!!</h1>
                </div>

                <a href="#" className="scroll-down">
                    <div className="mouse">
                        <span></span>
                    </div>
                    <div className="arrow">
                        <span></span>
                    </div>
                </a>

            </div>
        )
    }
}
